CREATE DEFINER=`yh1c6839`@`localhost` PROCEDURE `get_certificate` (IN `callsign` VARCHAR(30))  BEGIN
	
	IF (callsign LIKE 'Y%') THEN
         SELECT 
		col_call,
		CASE WHEN nilai  >= 13  THEN 1 ELSE 0 END AS bronze ,
		CASE WHEN nilai  >= 18  THEN 1 ELSE 0 END AS silver,
		CASE WHEN nilai  >=27   THEN 1 ELSE 0 END AS gold ,
		CASE WHEN nilai  >=36  THEN 1 ELSE 0 END AS platinum  
		 


		FROM view_yb_certificate WHERE COL_CALL = callsign ;
		ELSE
		  SELECT 
			col_call,
			CASE WHEN nilai  >= 8  THEN 1 ELSE 0 END AS bronze ,
			CASE WHEN nilai  >= 13  THEN 1 ELSE 0 END AS silver,
			CASE WHEN nilai  >=18   THEN 1 ELSE 0 END AS gold ,
			CASE WHEN nilai  >=27  THEN 1 ELSE 0 END AS platinum  
			 


			FROM view_dx_certificate WHERE COL_CALL = callsign;
		END IF;
	END$$

